import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import data from './data.json';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello World!</h1>
        <table>
          <thead>
            <th>Name</th>
            <th>Address</th>
            <th>Name</th>
            <th>Name</th>
            <th>Name</th>
            <th>Name</th>
          </thead>
        </table>
      </div>
    );
  }
}

export default App;
